Вечеринки в Queens

06 Nov 2019


с 6 по 10 ноября



Queens


Ресторан Queens приглашает на вечеринки.
Программа:

6 ноября — Di Live, DJ Gera;
7 ноября — Popeloff Trio, DJ Gera;
8 ноября — Bek, Fun Trip, DJ Gera, DJ Miwka;
9 ноября — Bek, Fun Trip, DJ Gera, DJ Pashkov;
10 ноября — Di Live, DJ Baga.

Резерв столиков по номерам: (+998) 99-443-7227, (+998) 99-442-7227.

